import Carousel from 'react-bootstrap/Carousel';
import Calistenia from "../img/ImgActivities/Calistenia.jpg";
import Crossfit from "../img/ImgActivities/CROSSFIT.jpg";
import Funcional from "../img/ImgActivities/FUNCIONAL.jpg";
import '../styles/carousel.css'

function CarouselFadeExample() {
  return (
    <div className='carousel-container'>
      <Carousel fade>
      <Carousel.Item>
        <img
          className="d-block"
          src={Calistenia}
          alt="First slide"
          style={{
            height: '50vw',
            width: '100vw',
            objectFit: 'cover'
          }}
        />
        <Carousel.Caption>
          <h3>Calistenia</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block"
          src={Funcional}
          alt="Second slide"
          style={{
            height: '50vw',
            width: '100vw',
            objectFit: 'cover'
          }}
        />

        <Carousel.Caption>
          <h3>Funcional</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block"
          src={Crossfit}
          alt="Third slide"
          style={{
            height: '50vw',
            width: '100vw',
            objectFit: 'cover'
          }}
        />

        <Carousel.Caption>
          <h3>Crossfit</h3>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
    </div>
  );
}

export default CarouselFadeExample;
